import './styles.css'
export default function Search({ search, setSearch, handleSearch }) {
    function dis(){
        if(search.length > 0){
            return false
        }else{
            return true;
        }
    }

  return (
    <div className="search-engine">
      <input
        type="text"
        placeholder="Enter a city name"
        name="search"
        value={search}
        onChange={(event) => setSearch(event.target.value)}
      />
      <button onClick={handleSearch} disabled={dis}>Search</button>
    </div>
  );
}
